        content: "import { For, Show, type Accessor, type JSX } from \"solid-js\"\nimport type { CollapsibleRootProps } from \"@kobalte/core/collapsible\"\n\nimport {\n  Collapsible,\n  CollapsibleContent,\n  CollapsibleTrigger,\n} from \"@repo/tailwindcss/ui/v4/collapsible\"\nimport {\n  SidebarGroup,\n  SidebarGroupLabel,\n  SidebarMenu,\n  SidebarMenuButton,\n  SidebarMenuItem,\n  SidebarMenuSub,\n  SidebarMenuSubButton,\n  SidebarMenuSubItem,\n} from \"@repo/tailwindcss/ui/v4/sidebar\"\n\nconst NavMain = (props: {\n  items: {\n    title: string\n    url: string\n    icon?: Accessor<JSX.Element>\n    isActive?: boolean\n    items?: {\n      title: string\n      url: string\n    }[]\n  }[]\n}) => {\n  return (\n    <SidebarGroup>\n      <SidebarGroupLabel>Platform</SidebarGroupLabel>\n      <SidebarMenu>\n        <For each={props.items}>\n          {(item) => (\n            <Collapsible\n              defaultOpen={item.isActive}\n              as={(props: CollapsibleRootProps) => (\n                <SidebarMenuItem {...props}>\n                  <CollapsibleTrigger<typeof SidebarMenuButton>\n                    as={(props) => (\n                      <SidebarMenuButton\n                        {...props}\n                        tooltip={item.title}\n                        class=\"[&>svg:last-of-type]:data-[expanded]:rotate-90\"\n                      >\n                        <Show when={item.icon!()}>{item.icon!()}</Show>\n                        <span>{item.title}</span>\n                        <svg\n                          xmlns=\"http://www.w3.org/2000/svg\"\n                          class=\"ml-auto transition-transform duration-200\"\n                          viewBox=\"0 0 24 24\"\n                        >\n                          <path\n                            fill=\"none\"\n                            stroke=\"currentColor\"\n                            stroke-linecap=\"round\"\n                            stroke-linejoin=\"round\"\n                            stroke-width=\"2\"\n                            d=\"m9 18l6-6l-6-6\"\n                          />\n                        </svg>\n                      </SidebarMenuButton>\n                    )}\n                  />\n                  <CollapsibleContent>\n                    <SidebarMenuSub>\n                      <For each={item.items}>\n                        {(subItem) => (\n                          <SidebarMenuSubItem>\n                            <SidebarMenuSubButton as=\"a\" href={subItem.url}>\n                              <span>{subItem.title}</span>\n                            </SidebarMenuSubButton>\n                          </SidebarMenuSubItem>\n                        )}\n                      </For>\n                    </SidebarMenuSub>\n                  </CollapsibleContent>\n                </SidebarMenuItem>\n              )}\n            />\n          )}\n        </For>\n      </SidebarMenu>\n    </SidebarGroup>\n  )\n}\n\nexport default NavMain\n"
